import React, { useEffect } from 'react';
import './App.css';
import { useStarWarsContext } from './Context/StarWarsContext';

function App() {
  const { test, fetchPlanetsStarWars } = useStarWarsContext();

  useEffect(() => {
    test;
    fetchPlanetsStarWars();
    console.log(test);
  }, [fetchPlanetsStarWars, test]);

  return (
    <div>
      <span>{test}</span>
    </div>
  );
}

export default App;
